import React, { Component} from 'react';
//import { render } from '@testing-library/react';

class ApiCall extends Component {
   constructor(props) {
      super(props) ;

         this.state = {
            data : [],
            isLoaded : false,
         }
}

fetchData() {
   fetch('172.22.132.200:8081')
   .then((response) => {
      return response.json()
   })
   .then((obj) => {
      this.setState({
         isLoaded : true,
         data: obj
      })
   })
}


componentDidMount() {

   this.fetchData();

    //fetch('https://api.mocki.io/v1/b043df5ab')
