    //  })
   //});
}

render() {
   var{isLoaded, data}= this.state;
   if(!isLoaded) {
      return <div> Loading....</div>
   }
   else {
      return (
         <div className='App'> 
            <ul>
               {data[0].city}
            </ul>
         </div>
      );
   }
}

}
export default ApiCall;;

